import { Routes, Route, Link } from "react-router-dom";
import Home from "./pages/home/Home";
import List from "./pages/list/List";

function App() {
  return (
    <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/hotels" element={<List/>} />
    </Routes>
  );
}

export default App;


